import React, { Component } from 'react';
// Icons
import { FaBell } from 'react-icons/fa';
import { FaPerson } from 'react-icons/fa';

export default class Nav extends Component {
  state = {
  }

  render () {
      return (
        <nav>
          <ul>
           <li><a href="/">Logo</a></li>
           <li><a href="/jobs">Jobs</a></li>
           <li><a href="/bookmarks">⭐️ Bookmarks</a></li>
           <li><a href="/notfication"><FaBell /></a></li>
           <li class="dropdown">
             <span id="nav-drop-link"><FaPerson /> Me <span class="dropdown-arr">&#x25BE;</span></span>
             <div class="dropdown-content">
               <a href="/user-profile">Profile</a>
               <a href="/user-settings">Settings</a>
             </div>
           </li>
           <li><input type="text" placeholder="Search for a job..."></input></li>
          </ul>
        </nav>
      )
   }
}
